import React from 'react';

function Dashboard({ goal }) {
  return (
    <div>
      <h2>Your Dashboard</h2>
      <p>Goal: {goal || 'Not set'}</p>
      {/* Add more dashboard features here, e.g. progress, stats, workouts, etc. */}
      <div style={{marginTop: '20px'}}>
        <h3>Progress</h3>
        <p>Track your progress here.</p>
        <h3>Workouts</h3>
        <p>View and manage your workouts.</p>
        <h3>Nutrition</h3>
        <p>Log your meals and nutrition info.</p>
        <h3>Food</h3>
        <ul style={{ listStyleType: 'none', paddingLeft: 0 }}>
          <li><strong>Morning:</strong> {/* Add morning food details here */}</li>
          <li><strong>Evening:</strong> {/* Add evening food details here */}</li>
          <li><strong>Post Evening:</strong> {/* Add post evening food details here */}</li>
          <li><strong>Night:</strong> {/* Add night food details here */}</li>
        </ul>
      </div>
    </div>
  );
}

export default Dashboard;
